import React from 'react';
import './FromAirport.scss';

const FromAirport : React.FC = props => {
    return (
        <section className={`from-airport`}>
            <h2>From airport to city center</h2>
                <h3>From airport to Syntagma (Σύνταγμα) station</h3>
                <p>Option 1 : Metro</p>Metro 3 (blue line) to Syntagma (Σύνταγμα) station, 50 min, every 30 min (05′ and 35′), 10€ 
                OR bus X95 (between exits 4 and 5 of arrivals terminal) to Syntagma (Σύνταγμα) station, 40-55 min, every 15-20 min (timetable : https://www.athensairportbus.com/en/timetable/x95airporttoathensdowntown.html - 19:40, 19:55, 20:10, 20:25, 20:40, 20:55), 6€
                The airport is 35 km away from the city center.
                <p>Option 2 : Bus X95</p>

                <h3>From Syntagma (Σύνταγμα) station to our Airbnb</h3>
        </section>
    );
}

export default FromAirport;
